import React from 'react'
import { View, Text, StyleSheet } from 'react-native'

const TextCenter = ({text}) => {
    return (
        <View style={css.container}>
            <Text style={css.text}>
                {text}
            </Text>
        </View>
    )
}

export default TextCenter

const css = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
        backgroundColor: '#000',
        width: 390,
        padding: 7
    },
    text: {
        color: '#fff',
        fontSize: 30,
    }
})
